      this.isNotQxFlag = false;
      this.isShowQxList = true;
      this.shRightShow = true;
      this.szRightShow = true;
      this.inits();
    },
    methods: {
      inits(){
        var that = this;
        localService.readMapMesg(['ISHKACCOUNT','ISHKSZACCOUNT'])
          .then((data)=>{
            if(data.ISHKACCOUNT == 1 && data.ISHKSZACCOUNT == 1){
              that.isShowQxList = false;
              return;
            }
            if(data.ISHKACCOUNT != 1 && data.ISHKSZACCOUNT != 1) that.isNotQxFlag = true;
            if(data.ISHKACCOUNT == 1){
              that.ISHKACCOUNT = '已开';
              that.shRightShow = false;
            }else {
              that.ISHKACCOUNT = '未开';
            }
            if(data.ISHKSZACCOUNT == 1){
              that.ISHKSZACCOUNT = '已开';
              that.szRightShow = false;
            }else {
              that.ISHKSZACCOUNT = '未开';
            }
          });
      },
      goOut(){
        this.isBtn = false;
        this.$TZT.action10402('',{logintype:2});
      },
      action10090(url){
        this.$TZT.action10090({url:url,isCheckLoginRight:'ggt'});
